import React from "react";
import "../CSS/App.css";

import account_logo from "../Images/계정로고.png";
import logo2 from "../Images/로고2.png";

export const Nav = () => {
  return (
    <nav>
      <div className="nav-item nav-item-right">
        <img className="account-logo-nav" src={account_logo} alt="계정로고" />
        <p>
          <strong>관리자</strong> 계정
        </p>
      </div>

      <img className="main-logo-nav nav-item" src={logo2} alt="메인로고" />

      <div className="nav-item nav-item-left button-box">
        <button className="button mdfy_info">정보수정</button>
        <button className="button">버튼2</button>
        <button className="button">버튼1</button>
      </div>
    </nav>
  );
};
